import Link from 'next/link';

const Index = () => (
  <div>
  <ul>
    <li><link herf="/"><a>Home</a></link></li>
    <li><link herf="/about"><a>About</a></link></li>
  </ul>
  <h1> Welcome to first Next JS Page!! </h1>
  </div>
);



export default Index;
